// App.js

import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import OsobaList from './components/OsobaList';

function App() {
    return (
        <Router>
            <div>
                <h2>Przykładowa Aplikacja</h2>

                {/* Przycisk przenoszący do OsobaList */}
                <Link to="/osoba-list">
                    <button>Przejdź do Listy Osób</button>
                </Link>

                {/* Trasa dla komponentu OsobaList */}
                <Route path="/osoba-list" component={OsobaList} />
            </div>
        </Router>
    );
}

export default App;
